import React, { Component } from 'react'

export class Quote extends Component {
  constructor(props){
    super(props);

  }

  render() {
    return (
      <div>
        <div id='text'>{this.props.quote.text}</div>
        <div id='author'>{this.props.quote.author}</div>
        <button id='new-quote' onClick={this.props.refreshQuote}>Refresh</button>
        <a id='tweet-quote' href='twitter/intent/tweet'>Tweet This quote</a>
      </div>
    )
  }
}

export default Quote
